import React from 'react';
import 'antd/dist/antd.css';
import PropTypes from 'prop-types';

const App = ({ Component }) => {
  return (
    <>
      <div>공통 메뉴</div>
      <Component />
    </>
  );
};

App.prototypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
